import logo from './logo.svg';
import './App.css';
import Welcome from './components/Welcome';
import Car from './components/Car';
import Login from './components/Login';

import { BrowserRouter as Routeur, Route, Link, Switch } from "react-router-dom";

function App() {
  return (
    <>
      <Routeur>
        <div>
          <nav>
            <ul>
              <li>
                <Link to="/home">Home</Link>
              </li>
            </ul>
          </nav>
        </div>
        <Login/>
      </Routeur>
    </>
  )
}

export default App;
